import cat404 from './img/404.webp'
import { Container } from './index.style'

const NotFound = () => {
  return (
    <Container>
      <img src={cat404} alt='not found' />
      <span> 404 NOT FOUND! </span>
    </Container>
  )
}

export default NotFound
